import React from "react";

function Collections () {
    return (
        <>
        <main className="collections">
            <div>
                <img src="./images/Aduke.jpg" alt="Aduke" />
            </div>
            <div>
                <img src="./images/DamDam.jpeg" alt="DamDam" />
            </div>
            <img src="./images/Eve.jpg" alt="Eve" />
            <img src="./images/Funmilayo.jpg" alt="Funmilayo" />
            <img src="./images/Olufayo.jpg" alt="Olufayo" />
        </main>
        </>
    )
}

export default Collections;
